import React from "react";
import PropTypes from "prop-types";

const ImageToggle = (props) => {
  return (
    <img
      src={props.primaryImgSrc}
      width="500px"
      height="500px"
      alt={props.alt}
    />
  );
};

export default ImageToggle;
